import { Box, Typography, Grid, Card, CardContent, CardMedia, CardActionArea, useTheme } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

export default function Dashboard() {
  const navigate = useNavigate();
  const theme = useTheme();

  const cards = [
    {
      title: 'Students',
      path: '/students/list',
      image: 'data:image/jpeg;base64,',
      description: 'View and manage student records.',
    },
    {
      title: 'Teachers',
      path: '/teachers/list',
      image: 'data:image/png;base64,',
      description: 'View and manage teacher records.',
    },
    {
      title: 'Subjects',
      path: '/subjects/list',
      image: 'data:image/jpeg;base64,',
      description: 'View and manage subject records.',
    },
    {
      title: 'Syllabus',
      path: '/syllabus/list',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRnd30Hr5fgvT-5uyy3Hf-3SPAk9133SHEQng&s',
      description: 'View and manage syllabus records.',
    },
    {
      title: 'Schools',
      path: '/schools/list',
      image: 'data:image/png;base64,',
      description: 'View and manage school records.',
    },
    {
      title: 'Classes',
      path: '/classes/list',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRv-G96YSgWiPPyl46pLnr-Iesr6uen0nNDgQ&s',
      description: 'View and manage class records.',
    },
    {
      title: 'Fees',
      path: '/fees/list',
      image: 'data:image/jpeg;base64,',
      description: 'View and manage fee records.',
    },
    {
      title: 'Admission',
      path: '/admission/form',
      image: 'data:image/jpeg;base64,',
      description: 'Process new admissions.',
    },
    {
      title: 'Exam',
      path: '/exam/schedule',
      image: 'data:image/jpeg;base64,',
      description: 'View and manage exam schedules.',
    },
  ];

  return (
     <Box p={2}>
      <Typography variant="h4" align="center" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        {cards.map((card, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                <CardActionArea onClick={() => navigate(card.path)}>
                  <CardMedia
                    component="img"
                    height="140"
                    image={card.image}
                    alt={card.title}
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="div">
                      {card.title}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {card.description}
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </motion.div>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}